import React from "react";
import { Button } from "react-bootstrap";
import { useNavigate } from "react-router";
import { useUserAuth } from "../context/UserAuthContext";

const Home = () => {
  const { logOut, user } = useUserAuth();
  const navigate = useNavigate();
  const handleLogout = async () => {
    try {
      await logOut();
      navigate("/");
    } catch (error) {
      console.log(error.message);
    }
  };
  return (
    <>
      <div className="text-center">
        Hello Welcome Velpula Sudha Homepage all information will be put here <br />
      </div>

      <form>
  <label>
    Name:
    <input type="text" name="name" />
  </label>

  <label>
    AGE
    <input type="text" age="name" />
  </label>

  <label>
    Gender
    <input type="text" gender="name" />
  </label>

  <label>
    email
    <input type="text" email="name" />
  </label>

  <label>
  chronicledesease
    <input type="text" chronicledesease="name" />
  </label>   

  <input type="submit" value="Submit" />
</form>









<p>
    <label>Employee ID : <input type="text" name="Id" value={this.state.employee.Id} 
				onChange={this.changeHandler} ></input>
	</label>
</p>
<p>
	<label>Employee Name : <input type="text" name="Name" 
                                 value={this.state.employee.Name} 
                                onChange={this.changeHandler}></input>
	</label>
</p>
<p>
	<label>Employee Location : <input type="text" name="Location" 
                            value={this.state.employee.Location} 
                            onChange={this.changeHandler}></input>
	</label>
</p>
<p>
	<label>Employee Salary : <input type="text" name="Salary"
							value={this.state.employee.Salary} 
                            onChange={this.changeHandler}></input>
	</label>
</p>



























      <div className="d-grid gap-2">
        <Button variant="primary" onClick={handleLogout}>
          Log out
        </Button>
      </div>
    </>

  );
};

export default Home;
